import '../'
import logo from '../../assets/logo.png';
import Navbar from '../navbar/Navbar';

function Header() {
    return (
        <header>
            <nav className='navbar'>
                <div className="logo">
                    <img
                        src={logo}
                        alt='logo'>
                    </img>
                </div>
                <Navbar />
            </nav>
        </header>
    );
}

export default Header;
